import React from 'react';

import "../css/Pagination.css";

function Pagination({ countries, inicio, final }) {

    
    return (
        <div className="paginado">
            <button
                className='change_page'
                name='backnumber'
            >
                {'<<'}
            </button>
            <div className='content_btn_page'>
                {
                    countries.length && countries.map((e) => {
                        return (
                            <button
                                name='pagenumber' 
                                key={e} id={e}
                                // onClick={() => onclickSelectPage(i + 1)}
                                // disabled={id === (i + 1) ? true : false}
                                // className={id === (i + 1) ? 'btn_page activo' : 'btn_page'}
                            >
                                {e}
                            </button>
                        )
                    }).slice(inicio, final)
                }
            </div>
            <button
                className='change_page'
                name='nextnumber'
            >
                {'>>'}
            </button>

        </div>
    )
}

export default Pagination;
